import React from "react";
import Card from "react-bootstrap/Card";
import Button from "react-bootstrap/Button";
import Rajashthan from "../../images/Rajasthan.jpg";

function Actions() {
  return (
    <div className="d-flex flex-column p-2 h-100">
      <Card className="mt-2">
        <Card.Img variant="top" src={Rajashthan} />
        <Card.Body>
          <Card.Text>Understand the power of Compounding</Card.Text>
          <Button style={{ backgroundColor: " #18287b" }}>Learn Now</Button>
        </Card.Body>
      </Card>
    </div>
  );
}

export default Actions;
